import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link, Redirect } from "react-router-dom";

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
         <AppRouter />
      </div>
    );
  }
}


const Invited = () => <h2>Invited</h2>;
const Accepted = () => <h2>Accepted</h2>;

const AppRouter = () => (
  <Router basename="/leads/">
    <div>
      <nav>
        <ul>

          <li>
            <Link to="/new/">Invited</Link>
          </li>
          <li>
            <Link to="/accepted/">Accepted</Link>
          </li>
        </ul>
      </nav>

      <Route path="/" exact   render={() => (
          <Redirect to="/new"/>
      )}/>
      <Route path="/new" component={Invited} />
      <Route path="/accepted" component={Accepted} />
    </div>
  </Router>
);

export default App;
